def rowToRating(row: Row): Rating = {
    val userId = Integer.valueOf(row.getAs[String]("userId"))
    val itemId = Integer.valueOf(row.getAs[String]("movieId"))
    val rating = java.lang.Double.valueOf(row.getAs[String]("rating"))

    Rating(userId, itemId, rating)
}

val ratingsRDD = ratings.rdd
    .map(rowToRating _)



// Build the recommendation model using ALS
val rank = 10
val numIterations = 10
val model = ALS.train(ratingsRDD, rank, numIterations, 0.01)

// Evaluate the model on rating data
val usersProducts = ratingsRDD.map { case Rating(user, product, rate) =>
  (user, product)
}

val predictions =
  model.predict(usersProducts).map { case Rating(user, product, rate) =>
    ((user, product), rate)
}

val ratesAndPreds = ratingsRDD.map { case Rating(user, product, rate) =>
  ((user, product), rate)
}.join(predictions)

val MSE = ratesAndPreds.map { case ((user, product), (r1, r2)) =>
  val err = (r1 - r2)
  err * err
}.mean()
println(s"Mean Squared Error = $MSE")

// Save and load model
model.save(sc, "target/tmp/myCollaborativeFilter")
val sameModel = MatrixFactorizationModel.load(sc, "target/tmp/myCollaborativeFilter")
